import React from "react"
import ReactDOM from "react-dom"
import "./style.css"
import Top from "./components/Top"
import Card from "./components/Main"
import bike from "./components/assets/bike.png"
import wedding from "./components/assets/wed.png"
import girl from "./components/assets/girl.png"

//props 
import data from "./data"

function App(){
    const cards = data 
    const elems = data.map(card => {
        return <Card 
        id = {card.id}
        title = {card.title} 
        description = {card.description}
        price = {card.price}
        coverImg = {card.coverImg}
        stats = {card.stats}
        location = {card.location}
        openSpots = {card.openSpots}
        />
    })
    return(
    <div className = "all">
        <Top/>
        <div className="cards">
            {elems}
        </div>
    </div>
    )
}

ReactDOM.render(
    <App/>,
    document.getElementById("root"))
